import React from 'react';
import Styles from './home.css';
import ReactDOMServer from 'react-dom/server';
import { Redirect } from 'react-router-dom';

class Home extends React.Component {
  constructor(props){
    super(props);
    };


  render(){
    return (
      <div className="Home">
        <div className="buscadorHome">
        <form>
          <div>
            <input type="search" id="miBusqueda" name="q" className="buscarHome" placeholder="ej: Una direccion o lo que quieras ordenar"/>
            <button className="buscarBotonHome">Buscar</button>
          </div>
        </form>
        </div>
        <div className="infoHome">
          
        </div>
      </div>
    );
  }
}



export default Home;
